import React from "react";
import { useSelector } from "react-redux";
export default function Order() {
  const order = useSelector((a) => state.reducer.order);
  return (
    <div>
      <h1>O kurwa</h1>
      {order.map((element) => (
        <p>{element}</p>
      ))}
    </div>
  );
}
